import React from 'react';
import { Link } from 'react-router-dom';
import './styles.css';

const Navbar = () => {
  return (
    <nav className="navbar navbar-expand-lg bg-light">
      <div className="container">
        <ul className="navbar-nav mx-auto gap-4">
          <li className="nav-item">
            <Link to="/" className="nav-link text-dark text-decoration-none fs-5">Accueil</Link>
          </li>
          <li className="nav-item">
            <Link to="/materiels" className="nav-link text-dark text-decoration-none fs-5">Remorques</Link>
          </li>
          <li className="nav-item">
            <Link to="/devis" className="btn btn-primary px-4 py-2">Devis</Link>
          </li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
